import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';
import { Container, Grid } from '../styles/globalStyles';

const TrainingContainer = styled.div`
  padding: 20px;
`;

const SectionTitle = styled.h2`
  color: ${props => props.theme.text};
  margin-bottom: 20px;
  font-size: 24px;
  font-weight: 700;
`;

const TrainingCard = styled.div`
  background: ${props => props.theme.cardBg};
  border-radius: 12px;
  padding: 20px;
  box-shadow: 0 4px 20px ${props => props.theme.shadow};
  border: 1px solid ${props => props.theme.border};
  transition: transform 0.2s ease, box-shadow 0.2s ease;
  animation: fadeIn 0.6s ease forwards;

  &:hover {
    transform: translateY(-5px);
    box-shadow: 0 8px 25px ${props => props.theme.shadow};
  }
`;

const TrainingImage = styled.div`
  height: 160px;
  border-radius: 8px;
  background: linear-gradient(45deg, ${props => props.theme.primary}, ${props => props.theme.accent});
  margin-bottom: 15px;
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: 24px;
  font-weight: 700;
`;

const TrainingTitle = styled.h3`
  color: ${props => props.theme.text};
  font-size: 18px;
  font-weight: 600;
  margin-bottom: 10px;
`;

const TrainingDescription = styled.p`
  color: ${props => props.theme.text};
  opacity: 0.8;
  margin-bottom: 15px;
  line-height: 1.5;
`;

const TrainingMeta = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const TrainingDate = styled.div`
  font-size: 14px;
  color: ${props => props.theme.text};
  opacity: 0.7;
`;

const StatusBadge = styled.div`
  padding: 4px 12px;
  border-radius: 20px;
  font-size: 12px;
  font-weight: 600;
  background: ${props => {
    switch(props.status) {
      case 'completed': return '#10b981';
      case 'upcoming': return '#3b82f6';
      case 'in-progress': return '#f59e0b';
      default: return '#6b7280';
    }
  }};
  color: white;
`;

const AccessDenied = styled.div`
  text-align: center;
  padding: 60px 20px;
  background: ${props => props.theme.cardBg};
  border-radius: 12px;
  border: 1px solid ${props => props.theme.border};
`;

const Training = ({ user }) => {
  const [trainings] = useState([
    {
      id: 1,
      title: 'Classroom Management Techniques',
      description: 'Learn effective strategies for maintaining a positive and productive classroom environment.',
      date: '2023-11-15',
      status: 'upcoming',
      icon: '🏫'
    },
    // ... other training items
  ]);
  const navigate = useNavigate();

  // Check if user is admin
  const isAdmin = user && user.role === 'admin';

  if (!isAdmin) {
    return (
      <TrainingContainer>
        <Container>
          <AccessDenied>
            <div style={{ fontSize: '48px', marginBottom: '20px' }}>🔒</div>
            <h3>Access Restricted</h3>
            <p>Only administrator users can access training management.</p>
            <p>Please contact your system administrator for access.</p>
          </AccessDenied>
        </Container>
      </TrainingContainer>
    );
  }

  return (
    <TrainingContainer>
      <Container>
        <SectionTitle>Professional Development</SectionTitle>

        <Grid>
          {trainings.map(training => (
            <TrainingCard key={training.id}>
              <TrainingImage>
                {training.icon}
              </TrainingImage>

              <TrainingTitle>{training.title}</TrainingTitle>
              <TrainingDescription>{training.description}</TrainingDescription>

              <TrainingMeta>
                <TrainingDate>{training.date}</TrainingDate>
                <StatusBadge status={training.status}>
                  {training.status.replace('-', ' ')}
                </StatusBadge>
              </TrainingMeta>
            </TrainingCard>
          ))}
        </Grid>
      </Container>
    </TrainingContainer>
  );
};

export default Training;
